import React from 'react'
import ReactDOM from 'react-dom'
import {loginRequested} from '../action/login'
import {LOGIN_STATUS} from '../const/login'

/**
* LoginFormコンポーネント
* @see http://qiita.com/nownabe/items/2d8b92d95186c3941de0
*/
export default class LoginForm extends React.Component{
  /**
  * コンストラクタ
  * @param {Object} props プロパティ
  * @return {undefined}
  */
  constructor(props){
    super(props);
    //ES2015版のReactだとこのおまじないをしないとメソッド内でthisが解決しない...
    this.handleSubmit = this.handleSubmit.bind(this);
  }

  /**
  * ログインボタンのクリックをハンドリングするメソッド
  * @return {undefined}
  */
  handleSubmit(){
    /*
    *入力されたID/Passを取得して、
    *それを元にLOGIN_REQUESTED(ログイン要求)アクションを作成してdispatchする
    */
    const userid = ReactDOM.findDOMNode(this.refs.userid).value.trim();
    const password = ReactDOM.findDOMNode(this.refs.password).value.trim();
    if(userid && password){
      this.props.dispatch(loginRequested(userid,password));
    }
  }

  /**
  * 描画メソッド
  * @return {undefined}
  */
  render(){
    //現在の状態がLOGIN_STATUS.FAILURE(ログイン失敗)であれば失敗メッセージを表示する
    const message = this.props.login.status == LOGIN_STATUS.FAILURE ?
      "IDもしくはパスワードが正しくありません" :
      "";

    return (
      <div>
        <span>id:</span><input type="text" ref="userid"/>
        <br />
        <span>pass:</span><input type="password" ref="password"/>
        <br />
        <button onClick={this.handleSubmit}>Login</button>
        <br />
        <span style={{color:"red"}}>{message}</span>
      </div>
    );
  }
}

import React from 'react'
import ReactDOM from 'react-dom'
import {myDestinationChange} from '../action/mydestination'

/**
* "自分の行き先"コンポーネント
* @see http://qiita.com/nownabe/items/2d8b92d95186c3941de0
*/
export default class MyDestination extends React.Component{
  /**
  * コンストラクタ
  * @param {Object} props
  * @return {undefined}
  */
  constructor(props){
    super(props);
    //ES2015版のReactだとこのおまじないをしないとメソッド内でthisが解決しない...
    this.hundleChange = this.hundleChange.bind(this);
  }
  /**
  * 行き先の変更をハンドリングするメソッド
  * @return undefined
  */
  hundleChange(){
    //入力された出勤・退勤とコメントを両方取得してMY_DESTINATION_CHANGEアクションをdispatchする
    const inBusiness = ReactDOM.findDOMNode(this.refs.inBusiness).value == 1; // state上はbooleanなのでここで変換
    const comment = ReactDOM.findDOMNode(this.refs.comment).value;

    this.props.dispatch(myDestinationChange({inBusiness:inBusiness, comment:comment}));
  }

  /**
  * 描画メソッド
  * @return {undefined}
  */
  render(){
    const inBusinessValue = this.props.mydestination.inBusiness ? 1 : 0;
    const commentValue = this.props.mydestination.comment;
    return (
      <div>
      <h3>自分の行き先</h3>
      <table>
        <tbody>
        <tr>
          <td>{this.props.login.user.userid}</td>
          <td>
            <select ref="inBusiness" value={inBusinessValue} onChange={this.hundleChange}>
             <option value={0}>退勤</option>
             <option value={1}>出勤</option>
            </select>
          </td>
          <td>
            <input type="text" ref="comment" value={commentValue} onChange={this.hundleChange}/>
          </td>
        </tr>
        </tbody>
      </table>
      </div>);
  }
}

/**
* login state内のstatus定義。SUCCESS(成功)、FAILURE(失敗)、NOTYET(未実施)。
*/
export const LOGIN_STATUS={
  SUCCESS:"SUCCESS",
  FAILURE:"FAILURE",
  NOTYET:"NOTYET"
}

/*
* ローカルストレージのKeyのプレフィックス
*/
const LOCAL_STORAGE_PREFIX = "kyo-do.co.";

/**
* localStorageへ値をセットする
* @param {string} key キー
* @param {Object} value セットするオブジェクト
* @return {undefined}
*/
export function setToStorage(key,value){
  localStorage.setItem(LOCAL_STORAGE_PREFIX + key,JSON.stringify(value));
}
/**
* localStorageから値を取得する
* @param {string} key キー
* @return {Object} localStorageに保存されたオブジェクト
*/
export function getFromStorage(key){
  return JSON.parse(localStorage.getItem(LOCAL_STORAGE_PREFIX + key));
}
/**
* localStorageから値を削除する
* @param {string} key キー
* @return {undefined}
*/
export function removeFromStorage(key){
  localStorage.removeItem(LOCAL_STORAGE_PREFIX + key);
}

/**
* localStorage上にキーが存在するかを確認する
* @param {string} key キー
* @return {boolean} 存在すればTrue
*/
export function existsKeyOnStorage(key){
  return localStorage.getItem(LOCAL_STORAGE_PREFIX + key) !== null;
}

import {LOGIN_STATUS} from '../const/login'
import {LOGIN_SUCCESS,LOGIN_FAILURE,LOGIN_REQUESTED,LOGOUT_REQUESTED} from '../action/login'

/**
* ログイン reducer
* @see http://qiita.com/yasuhiro-okada-aktsk/items/9d9025cb58ffba35f864
* @param {Object} state 変更前のstate
* @param {Object} action dispatchされたaction
* @return {Object} 変更後のstate
*/
export default function login(state={status:"NOTYET",user:{}}, action){
  switch(action.type){
    case LOGIN_SUCCESS:
      return {status:LOGIN_STATUS.SUCCESS,user:action.payload};
    case LOGIN_FAILURE:
      return {status:LOGIN_STATUS.FAILURE,user:{}};
    case LOGOUT_REQUESTED:
      return {status:LOGIN_STATUS.NOTYET,user:{}};
    case LOGIN_REQUESTED:
      return {status:LOGIN_STATUS.NOTYET,user:{}};
    default:
      return state;
  }
}

import {MY_DESTINATION_CHANGE} from '../action/mydestination'

/**
* 自分の行き先 reducer
* @see http://qiita.com/yasuhiro-okada-aktsk/items/9d9025cb58ffba35f864
* @param {Object} state 変更前のstate
* @param {Object} action dispatchされたaction
* @return {Object} 変更後のstate
*/
export default function mydestination(state={inBusiness:false,comment:""},action){
  switch(action.type){
    case(MY_DESTINATION_CHANGE):
      return action.payload;
    default:
      return state;
  }
}

import { combineReducers } from 'redux'
import login from './login';
import mydestination from './mydestination'

/**
* 各reducerを結合してひとまとめにしてexportする
